import React from 'react';

const Card = (props) => {
    return (
        <>
            <h2>{props.title}</h2>
            <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Qui harum voluptate dolor tenetur possimus rerum consectetur excepturi tempore ullam aliquid?</p>
        </>
    );
};

export default Card;
